import React from 'react';
import './App.css';
import MainPageWithMenu from './Components/mainPageWithMenu.js'
import HeaderImage from './Components/headerImage'
import HeaderText from './Components/headerText'
import Footer from './Components/footer'
import {Helmet} from 'react-helmet'

const coverPhoto = require('./images/coverVI.jpg')
const setarPhoto = require('./images/setar.png')

function App() {
  return (
    <div>
  <Helmet>
    <title>Shervin Dehghani</title>
    <meta name="description" content="This is the personal webpage of Shervin Dehghani. شروین دهقانی" />
  </Helmet>
  <div id="mainContainer">
    <div id="header" bordered>
      <HeaderImage image={coverPhoto} border="True"/>
      <HeaderText/>
    </div>
    <MainPageWithMenu/>
      <HeaderImage image={setarPhoto} border="False"/>      

    <Footer/>
  </div>
</div>
  );
}
export default App;
